using System;
using System.Collections.Generic;

namespace day3
{
    class Program
    {
        static void Main(string[] args)
        {
            var routes = new List<Route>
            {
                new Route{
                SlopeDepth = SkiSlope.Slope.Count,
                SlopeWidth =SkiSlope.Slope[0].Count,
                LateralMovement = 1,
                VerticalMovement = 1
                },
                new Route{
                SlopeDepth = SkiSlope.Slope.Count,
                SlopeWidth =SkiSlope.Slope[0].Count,
                LateralMovement = 3,
                VerticalMovement = 1
                },
                new Route{
                SlopeDepth = SkiSlope.Slope.Count,
                SlopeWidth =SkiSlope.Slope[0].Count,
                LateralMovement = 5,
                VerticalMovement = 1
                },new Route{
                SlopeDepth = SkiSlope.Slope.Count,
                SlopeWidth =SkiSlope.Slope[0].Count,
                LateralMovement = 7,
                VerticalMovement = 1
                },new Route{
                SlopeDepth = SkiSlope.Slope.Count,
                SlopeWidth =SkiSlope.Slope[0].Count,
                LateralMovement = 1,
                VerticalMovement = 2
                }
            };

            var treeCounts = SkiSlope.CountRouteTrees(routes);

            long multiplier = 1;
            foreach (var (route, count) in treeCounts)
            {
                Console.WriteLine($"{route.LateralMovement} {route.VerticalMovement} Tree count {count}");
                multiplier = multiplier * count;
            }
            Console.WriteLine(multiplier);
        }
    }
}

public class Route
{
    public int SlopeDepth { get; set; }
    public int SlopeWidth { get; set; }

    public int LateralMovement { get; set; }
    public int VerticalMovement { get; set; }
}


public static class SkiSlope
{
    public static Dictionary<Route, int> CountRouteTrees(List<Route> routes)
    {
        var treeCounts = new Dictionary<Route, int>();
        foreach (var route in routes)
        {
            var horizontalIndex = 0;
            var treeCount = 0;
            for (var level = 0; level < route.SlopeDepth; level += route.VerticalMovement)
            {
                if (Slope[level][horizontalIndex] == '#') treeCount++;
                horizontalIndex = horizontalIndex + route.LateralMovement;
                if (horizontalIndex >= route.SlopeWidth) horizontalIndex = horizontalIndex - route.SlopeWidth;
            }
            treeCounts.Add(route, treeCount);
        }

        return treeCounts;
    }

